(function() {
    let css = "";
    if (location.href.startsWith("")) {
        css += `
@font-face {
    font-family: f_524669777;
    src: url(data:application/vnd.ms-fontobject;base64,); src: url(data:application/vnd.ms-fontobject;base64,) format('eot'), url(data:font/woff2;base64,) format('woff2'), url(data:font/ttf;base64,) format('truetype');
}
.j_524669772{
    font-family: f_524669777 !important
}
  `;
}
    if (typeof GM_addStyle !== "undefined") {
        GM_addStyle(css);
    } else {
        let styleNode = document.createElement("style");
        styleNode.appendChild(document.createTextNode(css));
        (document.querySelector("head") || document.documentElement).appendChild(styleNode);
    }
})();

